        openMetadataCard: function ( id, typeId, isDoubleClick ) {
            // Set virtual selection in MFiles to open metadata card
            let apiObjectArray = MFiles.CreateInstance( "ObjOrFileVers" );

            // Create API object for metadata card
            let apiObject = MFiles.CreateInstance( "ObjOrFileVer" );
            apiObject.ObjVer.ID = id,
            apiObject.ObjVer.Type = typeId,
            apiObject.ObjVer.Version = -1; 

            apiObjectArray.Add( -1, apiObject )

            shellFrame.Listing.SetVirtualSelection( apiObjectArray );

            // If double click expand right pane
            // shellFrame.RightPane.Minimized = !isDoubleClick;
        }

